// React
import React from "react";
import PropTypes from "prop-types";
import { Link } from "react-router-dom";

function MenuInstallations(props) {
  const { menuItems } = props;

  return (
    <div id="menuContainer">
      <div id="menu">
        {menuItems.map((menuItem, index) => {
          const route = menuItem["Route"];
          const title = menuItem["Title"];
          return (
            <Link
              className="menuOption clickable"
              to={route}
              key={`menu-${route}`}
            >
              <>
                <span className="menuOptionTitle">{title}</span>
                {menuItem["Location"] && (
                  <>
                    <br />
                    <span className="menuOptionSubtitle">
                      {menuItem["Location"]}
                    </span>
                  </>
                )}
                {menuItem["Dates"] && (
                  <>
                    <br />
                    <span className="menuOptionSubtitle">
                      {menuItem["Dates"]}
                    </span>
                  </>
                )}
              </>
            </Link>
          );
        })}
      </div>
    </div>
  );
}

MenuInstallations.propTypes = {
  menuItems: PropTypes.array,
};

export default MenuInstallations;
